import styled from 'styled-components';

const Section = styled.div`
  padding: 16px;
`;

const Container = styled.div`
  padding: 16px;
  margin-top: 16px;
`;

const Action = styled.div`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
`;

const Inheader = styled.div`
`;

function Issue() {
  return (
    <Section>
      <Container>
        <Action>
          <Inheader></Inheader>
        </Action>
      </Container>
    </Section>
  );
}

export default Issue;
